function App() {
  const choice=prompt("Whon areyou");
  <Routes>
    <Route path='/admin' element={<Admin/>}/>
  </Routes>

  return localStorage.getItem('key') === '120'? <Admin /> : <Teacherlogin />;

}

export default App;
